import './App.css';

function App() {
  return (
    <div className="App">
      <div>
        <img className="bridge" alt="bridge1" src="img/home1.png"/>
      </div>
      <div className>
        <ul className="homeBtn">
          <li className="homeBtn1">여행지</li>
          <li className="homeBtn1">음식점</li>
          <li className="homeBtn1">숙박</li>
          <li className="homeBtn1">기타</li>
        </ul>
      </div>
    </div>
  );
}

export default App;
